import React from 'react';
import link from 'react-router-dom';

const Navbar=()=>{
    <div>
        <ul>
            <li><link to='/'>Home</link></li>
            <li><link to='/login'>Login</link></li>
            <li><link to='/register'></link>Register</li>
        </ul>
    </div>
}
